SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_CATEGORY_GRAPHICS, "Graphics", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_CLUTTER_2D_QUALITY, "Grass", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_CLUTTER_2D_QUALITY_TOOLTIP, "Determines the amount of grass and ground clutter in the world. Higher settings increase the distance at which grass is visible. Decreasing this setting may increase performance.", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DEPTH_OF_FIELD_MODE, "Depth of Field", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DEPTH_OF_FIELD_MODE_TOOLTIP, "Determines the appearance of depth of field which simulates the photographic effect that causes distant objects to appear out of focus based on the distance they are from objects in the foreground.", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DISPLAY_MODE, "Display Mode", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DISPLAY_MODE_TOOLTIP, "Sets the game's primary display mode.", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DISTORTION, "Distortion", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_DISTORTION_TOOLTIP, "Causes certain objects in the world to display distortion effects in their vicinity. Disabling this may improve performance.", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_GAMMA_ADJUSTMENT, "Gamma Adjustment", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_GAMMA_ADJUSTMENT_TOOLTIP, "Adjusts the overall gamma (brightness) setting of the game with no impact to performance. Change this setting if the game appears too bright or dark on your display.", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_GOD_RAYS, "Sunlight Rays", 0)
