SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_SCREENSPACE_WATER_REFLECTION_QUALITY, "Screenspace Reflection Quality", 0)
SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_SCREENSPACE_WATER_REFLECTION_QUALITY_TOOLTIP, "Determines the quality of screenspace reflections shown on the surface of water. Increasing this setting will improve the accuracy of the reflection but may decrease performance.", 0)
