SafeAddString(SI_GRAPHICS_OPTIONS_VIDEO_SHADOWS_TOOLTIP, "Determines the quality of shadows seen in the world. Higher settings increase the shadow's draw distance, sharpness and the number of objects in the world that cast shadows. Decreasing this quality may help  improve performance.", 0)
